import React from "react"
import { Link } from "react-router-dom"

function Navigation(){
    return (
    <div>
        <div className="nav-logo">
            <Link to="/">홈으로</Link>
        </div>
        <div className="nav-login">
            <Link to="/login">로그인</Link>
            <Link to="/register">회원가입</Link>
        </div>
    </div>
    );
}

export default Navigation;
